import { Route, Routes } from "react-router-dom";
import CelebretiesBox from "./components/CelebretiesBox";

function App() {
  return (
    <Routes>
      <Route path="/" element={CelebretiesBox} />
      <Route path="/book" element={CelebretiesBox} />
    </Routes>
  );
}

export default App;
